  var args = funcobj.args;
  var decls = funcobj.decls;
  var exprs = funcobj.exprs;
  emit('#"'+funcname+'[f'+args.length+']" = ');
  emit("[");
  nameTable = {};
  namesInTable = 0;
  //emit("(MakeVal null)");
  //emit("(Push)");
